package build.wallet.emergencyexitkit

import build.wallet.bitkey.keybox.Keybox
import build.wallet.cloud.backup.csek.SealedCsek
import com.github.michaelbull.result.Ok
import com.github.michaelbull.result.Result

class EmergencyExitKitAppKeyParametersProviderFake :
  EmergencyExitKitAppKeyParametersProvider {
  private val fakeEncodedPayload = ""

  override suspend fun parameters(
    keybox: Keybox,
    sealedCsek: SealedCsek,
  ): Result<AppKeyParameters, Error> =
    Ok(
      AppKeyParameters(
        appKeyCharacters = fakeEncodedPayload,
        appKeyQRCodeText = fakeEncodedPayload
      )
    )
}
